    function_selector: FunctionSelector,
    args_hash: Field,
    side_effect_counter: u32
) -> [Field; ENQUEUE_PUBLIC_FUNCTION_CALL_RETURN_SIZE] {
    enqueue_public_function_call_oracle(
        contract_address,
        function_selector,
        args_hash,
        side_effect_counter
    )
}

